import React, { Component }   from 'react';
import NavigationBar          from './components/home/navigationBar';
import HomeLeftPanel          from './components/home/homeLeftPanel';
import HomeLeftDownPanel      from './components/home/homeLeftDownPanel';
import HomeRightPanel         from './components/home/homeRightPanel';
//import HomeCenterPanel1 from './components/home/homeCenterPanel1';
import MatchHeader            from './components/home/matchHeader';
import {Route, Switch, }      from 'react-router-dom';
import Feeds                  from './components/home/homeCenterPanel1';
import Series                 from './components/series/series';
import Videos                 from './components/videos/videos';
import Stories                from './components/stories/stories';
import Ranking                from './components/ranking/ranking';
import Login                  from './components/login/login';
import NotFound               from './components/common/notFound';
import FeaturedSeries         from './components/leftPanel/featuredSeries';
import Summary                from './components/summary/summary';


import './App.css';
import './assets/css/common/shortMenu.css';
import './assets/css/home/navigationBar.css';
import './assets/css/common/videoCards.css';

//import BasicExample from './components/home/BasicExample';

class App extends Component {

  render() {
    return (
      // <div className="App">
      <div className="App">

        <div className='container-fluid' style={{ marginBottom: 6 + "px", backgroundColor: 'White' }}>
          <div className="row">
            <div className="col-12 pl-0 pr-0">
              <NavigationBar />
            </div>
          </div>
        </div> 

        <div className="container">
          {/* <BasicExample /> */}
          <div id='HomeLiveMatchHeader' className="row">
            <div className="col-12 pl-0 pr-0 mb-3">
              <MatchHeader />
            </div>
          </div>

          <div className="row">

            {/* <div className="col-lg-2 col-md-2 col-sm-3 col-xs-12 pl-2 pr-0"> */}
            <div id='leftPanel' className="d-md-none d-lg-block col-lg-2 pl-0">
              <div style={{ paddingBottom: 15 + 'px' }}>
                <HomeLeftPanel />
              </div>

              <div >
                <HomeLeftDownPanel />
              </div>
            </div>


            <div id='HomeCenterPanel' className="col-xs-12 col-sm-12 col-md-12 col-lg-7 p-0">
              <Switch>
                <Route path="/"                          strictly exact component={Feeds} />
                <Route path="/videos"                    strictly exact component={Videos} />


                <Route path="/series"                     strictly exact component={Series} />
                <Route path="/series/allseries/live"      strictly exact component={Series} />
                <Route path="/series/allseries/upcoming"      strictly exact component={Series} />
                <Route path="/series/allseries/recent"      strictly exact component={Series} />


                <Route path="/stories"    strictly exact component={Stories} />
                <Route path="/ranking"    strictly exact component={Ranking} />
                <Route path="/leftPanel/" strictly exact component={FeaturedSeries} />

                <Route path="/leftPanel/:id/:title/:type" strictly exact component={FeaturedSeries} />

                <Route path="/summary/"   strictly exact component={Summary} />
                <Route path="/login/"     strictly exact component={Login} />
                <Route component={NotFound} />
              </Switch>

              <div className="content"> 

              </div>
               {/* <HomeCenterPanel1 /> */}
            </div>

            <div id='HomeRightPanel' className=" d-md-none d-lg-block col-lg-3 pr-0">
              <div>
                <HomeRightPanel />
              </div>
            </div>
            </div>
          </div>
        </div>
    );
  }
}

export default App;
